import Item from '../Components/Item/Item'
import ItemHover from '../Components/Item/ItemHover'

export default class ProductItems extends Component {
    render() {
        return (

            <div className="product__item">
                {/* ITEM */}
                <Item />
                {/* ITEM HOVER */}
                <ItemHover />
            </div>


        )
    }
}
